function GetEpisode(PodcastID, setlistaNoticia, setListaEpisodiosProgramas){
    fetch(`https://api.spreaker.com/v2/shows/` +
                        PodcastID +
                        `/episodes`
    )
    .then((response)=>response.json())	
    .then((episodes) => {
        setlistaNoticia(episodes.response.items)
        console.log(episodes.response)


    })
}

export default GetEpisode
